import React from "react";
import axios from "axios";

export default function Test() {
  const abc = async () => {
    try {
      return await axios.get(
        "http://localhost:8500/celerant360/server/coldfusion/taxonomy.cfc?method=getTaxonomy"
      );
    } catch (error) {
      console.error(error);
    }
  };
  const xyz = async () => {
    const breeds = await abc();
    console.log("rrrrrrrr");
    console.log(breeds);
  };
  let res = xyz();
  return "";
}
